import React from 'react'
import Link from'next/link'


const Index=()=>{
    return (
        <div>
            <p className = 'mt-5 text-center'>Nós do estabelecimento y prezamos sempre por fornecer um excelente 
            serviço a nossos clientes por esse motivo estamos sempre abertos a críticas e sugestões</p>
            
        </div>
    )
}

export default Index
